import React, { Component } from 'react';
import Camera from "./import/camera";
import Header from './import/header';
class Index extends Component {
    state = { 
        style:{
            bgColor:'#323232',
            base:{
                backgroundColor:'#323232',
                width:'100vw',
                height:'100vh',
                position:'absolute',
                color:'white',
                top:500,
                left:0
            },
            header:{
                width:'100vw',
                minHeight:'10vh',
                backgroundColor:'red'
            }
        }
     }
    render() { 
        return ( 
            <div style={this.state.style.base}>
                <header></header>
                <h2>Welcome to react!</h2> 
                <Camera/>
            </div>
            );
    }
}

export default Index;
